export default function Example() {
    const [count, setCount] = useState(0);
    const [color, setColor] = useState("");

    useEffect(() => {
        document.title = `You clicled ${count} times`;
    })

    return(
        <div>
            <p>You clicked {count} times</p>
            <button onClick={() => setCount(count + 1)}>
                Click me
            </button>
        </div>
    )
}
